import "./Tabs.css";
import { PIERCING } from "../../images/images";

export const Tabs = ({ piers }) => {
  return (
    <div className="tabs__item">
      <img src={PIERCING} className="tabs__img" />
      <div className="tabs__box">
        <div className="tabs__subtitle">{piers.title}</div>
        <div className="tabs__descr">{piers.descr}</div>
        <a href="" className="tabs__link"></a>
        <hr />
        <div className="tabs__footer">
          <div className="tabs__prices">{piers.price}</div>
          <button className="tabs__btn">записаться</button>
        </div>
      </div>
    </div>
  );
};
